import React, { Component } from 'react';

class AboutUs extends Component {

    render(){
        return (
            <div className='container' style={{backgroundColor: process.env.REACT_APP_SECTION_HIGHLIGHT }}>
                <div className='row'>
                    <h3 className='orange-text'>Sobre Nos</h3>
                    <h6>Venha nos conhecer</h6>
                    <div className='col s8 left-align'>
                        <strong className='orange-text'><h5>{ process.env.REACT_APP_ABOUT_TITLE }</h5></strong>
                        <p>{ process.env.REACT_APP_ABOUT_INTRO }</p>
                        {process.env.REACT_APP_ABOUT_SERVICES.split(',').map( s  =>
                            <p>{ s }</p>
                        )}
                        <p>{ process.env.REACT_APP_ABOUT_CONCLUSION }</p>
                    </div>
                    <div className='col s4'>
                        <img className="responsive-img" style={{border: '3px solid #ffa000', padding: '20px', marginTop: '30%'}} src={require("../../../static/imgs/logo512.png")}/>
                    </div>
                </div>
            </div>
        )
    }
}

export default AboutUs
